INSERT INTO `hotelview_news` VALUES (1,'Discord','T afim de ficar sabendo em primeira mo as novidades do Mania? Ento se liga s!<br><br>Como todos sabem, desde o incio o Mania visa a importncia dos users e a participao dos mesmos para a melhoria do Hotel. Pensando nisso, estaremos disponibilizando um server online para os usurios, onde podero opinar, dar sugestes, ficar de olho nas novidades, tirar dvidas com Staffs e interagir com eles e com outros usurios.<br><br>Curtiu a ideia? Ento  s entrar no nosso Discord.','Clique aqui','web','https://discord.gg/WNWSJCa','web_promo_small/discord.png');
